import React, { useState, useEffect } from 'react';

const MatrixTable = () => {
  const [classData, setClassData] = useState([]);

  useEffect(() => {
    // Simulating fetching data from an API endpoint
    fetch('api/classData')
      .then(response => response.json())
      .then(data => setClassData(data))
      .catch(error => console.error('Error fetching class data:', error));
  }, []);

  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>Class Name</th>
            <th>No of Payments</th>
            <th>Payment from Date</th>
            <th>Payment To Date</th>
            <th>Late Fee % Per Day</th>
            <th>Book Fee</th>
            <th>Management Fee</th>
            <th>Security Deposit</th>
            <th>Stationary Fee</th>
            <th>Transportation Fee</th>
            <th>Taxes</th>
            <th>Total</th>
          </tr>
        </thead>
        <tbody>
          {classData.map((classItem, idx) => (
            <tr key={idx}>
              <td>{classItem.className}</td>
              <td>{classItem.paymentParticulars.noOfPayments}</td>
              <td>{classItem.paymentParticulars.paymentFromDate}</td>
              <td>{classItem.paymentParticulars.paymentToDate}</td>
              <td>{classItem.paymentParticulars.lateFeePercentage}</td>
              <td>{classItem.paymentParticulars.bookFee}</td>
              <td>{classItem.paymentParticulars.managementFee}</td>
              <td>{classItem.paymentParticulars.securityDeposit}</td>
              <td>{classItem.paymentParticulars.stationaryFee}</td>
              <td>{classItem.paymentParticulars.transportationFee}</td>
              <td>{classItem.paymentParticulars.taxes}</td>
              <td>{classItem.paymentParticulars.total}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MatrixTable;
